import React from "react";

// reactstrap components
import { Button, Card, Form, Input, Container, Row, Col } from "reactstrap";

// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
import MynavSign from "components/Navbars/MynavSign.js";

function RegisterPage() {
  document.documentElement.classList.remove("nav-open");
  React.useEffect(() => {
    document.body.classList.add("register-page");
    return function cleanup() {
      document.body.classList.remove("register-page");
    };
  });
  return (
    <>
      <MynavSign />
      <div
        className="page-header"
        style={{
          backgroundImage: "url(" + require("assets/img/ln4.jpg") + ")",
        }}
      >
        <div className="filter" />
        <Container>
          <Row>
            <Col className="ml-auto mr-auto" lg="4">
              <Card className="card-sign ml-auto mr-auto">
                <h3 className="title mx-auto">Welcome</h3>
                <Form className="sign-form">
                <label>Full Name</label>
                  <Input placeholder="Full name" type="text" />
                  <label>Birthday</label>
                  <Input placeholder="Birthday" type="date" />
                  <label>Country</label>
                  <Input placeholder="Country" type="text" />
                  <label>Contact Number</label>
                  <Input placeholder="Contact Number" type="number" />
                  <label>Email</label>
                  <Input placeholder="Email" type="text" />
                  <label>Password</label>
                  <Input placeholder="Password" type="password" />
                  <label>Confirm Password</label>
                  <Input placeholder="Password" type="password" />
                  <Button block className="btn-round" color="info" href="/home">
                    Sign In
                  </Button>
                </Form>
              </Card>
            </Col>
          </Row>
        </Container>
        <div className="footer register-footer text-center">
          <h6>
            © {new Date().getFullYear()}, made with{" "}
            <i className="fa fa-heart heart" /> by Ravidu
          </h6>
        </div>
      </div>
    </>
  );
}

export default RegisterPage;
